nswer`,`title`,`type`,`status`,`task_id`,`creator_id`,`create_time`,`modifier_id`,`modify_time`) values (4,'是这样子的，我们公司会根据您的实际情况，为您匹配到低费率而且是较快的贷款产品，当然我们公司也会收取贷款额少量比例的服务费用，具体多少还是根据客户实际情况来定的。','手续费',1,1,2,1,'2018-06-01 15:03:42',NULL,NULL);insert  into `p2p_reply`(`id`,`answer`,`title`,`type`,`status`,`task_id`,`creator_id`,`create_time`,`modifier_id`,`modify_time`) values (5,'恩，这个是需要看给你走什么产品的，快的话，咱们可以2天','放款周期',1,1,2,1,'2018-06-01 15:04:03',NULL,NULL);insert  into `p2p_reply`(`id`,`answer`,`title`,`type`,`status`,`task_id`,`creator_id`,`create_time`,`modifier_id`,`modify_time`) values (6,'我们这有月2','利息多少',1,1,2,1,'2018-06-01 15:04:57',NULL,NULL);insert  into `p2p_reply`(`id`,`answer`,`title`,`type`,`status`,`task_id`,`creator_id`,`create_time`,`modifier_id`,`modify_time`) values (7,'我们在成都这边都做了5年了，已经成功为数十万的贷款客户，解决了他们的融资问题。','资质',1,1,2,1,'2018-06-01 15:05:34',NULL,NULL);insert  into `p2p_reply`(`id`,`answer`,`title`,`type`,`status`,`task_id`,`creator_id`,`create_time`,`modifier_id`,`modify_time`) values (8,'恩，是这样子的，我们公司目前，是和跟多家银行和融资机构都在合作的，一般会您那边的具体情况来为你量身定做最佳贷款方案的。','贷款方案',1,1,2,1,'2018-06-01 15:06:10',NULL,NULL);insert  into `p2p_reply`(`id`,`answer`,`title`,`type`,`status`,`task_id`,`creator_id`,`create_time`,`modifier_id`,`modify_time`) values (9,'这个您可以放心，您可以来我们公司当面了解一下的呀，眼见为实的嘛，对吧。','信用度',1,1,2,1,'2018-06-01 15:06:41',NULL,NULL);insert  into `p2p_reply`(`id`,`answer`,`title`,`type`,`status`,`task_id`,`creator_id`,`create_time`,`modifier_id`,`modify_time`) values (10,'恩，现在这些都是比较方便的啦。不管您是抵押，还是信用贷款，资料准备都很简单的了','资料复杂度',1,1,2,1,'2018-06-01 15:07:07',NULL,NULL);insert  into `p2p_reply`(`id`,`answer`,`title`,`type`,`status`,`task_id`,`creator_id`,`create_time`,`modifier_id`,`modify_time`) values (11,'哦，我们准备的资料还是蛮简单的，就比如说：身份证，征信报告，还有社保，公积金或者房厂证，这些就可以了，这样吧，我一会还是发一个详细信息到您手机上，您到时看一下好吗?。','资料要求',1,1,2,1,'2018-06-01 15:07:40',NULL,NULL);insert  into `p2p_reply`(`id`,`answer`,`title`,`type`,`status`,`task_id`,`creator_id`,`create_time`,`modifier_id`,`modify_time`) values (12,'这个的话，还是看你那边是否愿意呀，如果您不想做抵押的话，那这边还是可以帮您操作信用贷款的。','不抵押贷款',1,1,2,1,'2018-06-01 15:08:03',NULL,NULL);insert  into `p2p_reply`(`id`,`answer`,`title`,`type`,`status`,`task_id`,`creator_id`,`create_time`,`modifier_id`,`modify_time`) values (13,'哦，这个您放心好了，我们公司是正规贷款平台，利息都是按照国家标准来的，这个您可以来我们公司详细了解一下的。','乱收费',1,1,2,1,'2018-06-01 15:08:23',NULL,NULL);insert  into `p2p_reply`(`id`,`answer`,`title`,`type`,`status`,`task_id`,`creator_id`,`create_time`,`modifier_id`,`modify_time`) values (14,'我们是做抵押，和个人信用贷款的','贷款类型',1,1,2,1,'2018-06-01 15:08:47',NULL,NULL);insert  into `p2p_reply`(`id`,`answer`,`title`,`type`,`status`,`task_id`,`creator_id`,`create_time`,`modifier_id`,`modify_time`) values (15,'恩，这个是这样子的，我们公司会根据您这个具体情况来，为为您匹配到低费率的产品，因为我这边市场部的，那么，具体情况，我安排我们专业的融资顾问来为您解答，如果方案您满意的话，您可以直接找我们办理，如果不满意的话，您就当做一个了解，也是可以的，对吧。','特殊情况',1,1,2,1,'2018-06-01 15:09:10',NULL,NULL);insert  into `p2p_reply`(`id`,`answer`,`title`,`type`,`status`,`task_id`,`creator_id`,`create_time`,`modifier_id`,`modify_time`) values (16,'我这边王，您叫我小王就可以了，稍后我给您发个信息过去，上面有我的姓名，还是手机号码，您随时联系我都是可以的','称呼',1,1,2,1,'2018-06-01 15:09:52',NULL,NULL);insert  into `p2p_reply`(`id`,`answer`,`title`,`type`,`status`,`task_id`,`creator_id`,`create_time`,`modifier_id`,`modify_time`) values (17,'这个贷多少的话，还是要根据您个人情况来定的哈，每个人的情况都不同的。','贷多少',1,1,2,1,'2018-06-01 15:10:13',NULL,NULL);insert  into `p2p_reply`(`id`,`answer`,`title`,`type`,`status`,`task_id`,`creator_id`,`create_time`,`modifier_id`,`modify_time`) values (18,'是的，我们也有很多网贷渠道，我这边安排贷款顾问给你回个电话具体讲解下，这样更方便您了解，您看好么？','网贷',1,1,2,1,'2018-06-01 15:15:53',NULL,NULL);insert  into `p2p_reply`(`id`,`answer`,`title`,`type`,`status`,`task_id`,`creator_id`,`create_time`,`modifier_id`,`modify_time`) values (19,'这样子吧，我先安排贷款顾问给您详细介绍下，看您的条件满足不。你再做决定。','远了',1,1,2,1,'2018-06-01 15:16:16',NULL,NULL);insert  into `p2p_reply`(`id`,`answer`,`title`,`type`,`status`,`task_id`,`creator_id`,`create_time`,`modifier_id`,`modify_time`) values (20,'要看您征信不好到什么程度，您看要么安排我们公司专业的融资顾问跟您详细沟通一下，然后给您匹配最好的贷款方案，您看可以吗',